INSERT INTO `query_feedback` (`auto_id`, `question`, `sql_query`, `feedback`, `created_at`) VALUES
(1, 'What is the best performing product in terms of revenue', 'SELECT productName, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productName\nORDER BY totalRevenue DESC\nLIMIT 1;', 1, '2025-01-27 14:14:17'),
(2, 'What is the best performing product in terms of revenue', 'SELECT productName, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productName\nORDER BY totalRevenue DESC\nLIMIT 1;', 1, '2025-01-27 14:15:32'),
(3, 'What is the worst performing product in terms of revenue', 'SELECT productId, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productId\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-01-27 16:08:31'),
(4, 'which source has got me', 'SELECT utm_source, COUNT(*) AS source_count\nFROM sessions\nGROUP BY utm_source\nORDER BY source_count DESC;', 1, '2025-01-27 16:11:08'),
(5, 'which source has got me the most money', 'SELECT utm_source, SUM(conversionValue) AS totalRevenue\nFROM conversions\nJOIN sessions ON conversions.sessionId = sessions.id\nGROUP BY utm_source\nORDER BY totalRevenue DESC\nLIMIT 1;', 1, '2025-01-27 16:12:14'),
(6, 'What is the best performing product in terms of revenue', 'SELECT productName, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productName\nORDER BY totalRevenue DESC\nLIMIT 1;', 1, '2025-01-28 12:52:59'),
(7, 'What is the worst performing product in terms of revenue', 'SELECT productId, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productId\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-01-28 12:53:23'),
(8, 'which source has got me the most money', 'SELECT utm_source, SUM(conversionValue) AS totalRevenue\nFROM conversions\nJOIN sessions ON conversions.sessionId = sessions.id\nGROUP BY utm_source\nORDER BY totalRevenue DESC\nLIMIT 1;', 1, '2025-01-28 12:56:08'),
(9, 'which source has got me the least money', 'SELECT utm_source, SUM(conversionValue) AS totalRevenue\nFROM conversions\nGROUP BY utm_source\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-01-28 12:56:28'),
(10, 'which source has got me the least money', 'SELECT utm_source, SUM(conversionValue) AS totalRevenue\nFROM conversions\nGROUP BY utm_source\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-01-28 12:57:48'),
(11, 'which source has got me the least money', 'SELECT utm_source, SUM(conversionValue) AS totalRevenue\nFROM conversions\nGROUP BY utm_source\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-01-28 13:37:31'),
(12, 'how many items didn\'t make t from cart to checkout', 'SELECT COUNT(*) AS items_not_made_checkout\nFROM add_to_cart a\nLEFT JOIN proceed_to_checkout p ON a.sessionId = p.sessionId AND FIND_IN_SET(a.productId, p.productIds) > 0\nWHERE p.id IS NULL;', 1, '2025-01-28 13:42:18'),
(13, 'how many items didn\'t make t from cart to checkout', 'SELECT COUNT(*) AS items_not_made_checkout\nFROM add_to_cart a\nLEFT JOIN proceed_to_checkout p ON a.sessionId = p.sessionId AND a.productId = ANY(p.productIds)\nWHERE p.id IS NULL;', 0, '2025-01-28 13:56:16'),
(14, 'how many items didn\'t make t from cart to checkout', 'SELECT COUNT(*) AS items_not_made_checkout\nFROM add_to_cart a\nLEFT JOIN proceed_to_checkout p ON a.sessionId = p.sessionId AND a.productId = ANY(p.productIds)\nWHERE p.id IS NULL;', 0, '2025-01-28 14:02:09'),
(15, 'how many items didn\'t make t from cart to checkout', 'SELECT COUNT(*) AS items_not_made_checkout\nFROM add_to_cart a\nLEFT JOIN proceed_to_checkout p ON a.sessionId = p.sessionId AND FIND_IN_SET(a.productId, p.productIds) > 0\nWHERE p.id IS NULL;', 1, '2025-01-28 14:19:37'),
(16, 'how many items didn\'t make t from cart to payment', 'SELECT COUNT(*) AS items_not_made_to_payment\nFROM add_to_cart a\nWHERE NOT EXISTS (\n    SELECT 1\n    FROM proceed_to_payment p\n    WHERE a.sessionId = p.sessionId AND FIND_IN_SET(a.productId, p.productIds)\n);', 1, '2025-01-28 14:23:42'),
(17, 'how many items didn\'t make t from cart to payment', 'SELECT COUNT(*) AS items_not_made_payment\nFROM add_to_cart a\nLEFT JOIN proceed_to_checkout p ON a.sessionId = p.sessionId AND FIND_IN_SET(a.productId, p.productIds) > 0\nLEFT JOIN proceed_to_payment pp ON a.sessionId = pp.sessionId AND FIND_IN_SET(a.productId, pp.productIds) > 0\nWHERE pp.id IS NULL;', 0, '2025-01-28 14:28:53'),
(18, 'how many items didn\'t make t from cart to payment', 'SELECT COUNT(*) AS items_not_made_ssas\nFROM add_to_cart a\nLEFT JOIN proceed_to_payment p ON a.sessionId = p.sessionId AND a.productId = ANY(p.productIds)\nWHERE p.id IS NULL;', 0, '2025-01-28 14:32:00'),
(19, 'What is the bounce rate?', 'SELECT \n    COUNT(CASE WHEN exitPage IS NULL THEN 1 END) * 100.0 / COUNT(*) AS bounce_rate\nFROM \n    sessions;', 1, '2025-01-28 14:33:51'),
(20, 'What is the bounce rate?', 'SELECT \n    COUNT(CASE WHEN exitPage IS NULL THEN 1 END) * 100.0 / COUNT(*) AS bounce_rate\nFROM \n    add_to_checkout;', 0, '2025-01-28 14:34:13'),
(21, 'how many sessions are present on the DB', 'SELECT COUNT(*) AS total_sessions FROM sessions;', 1, '2025-01-29 14:02:50'),
(22, 'How many users came to my website using the campaign name 	 sdk_validation', 'SELECT COUNT(DISTINCT s.userId) AS user_count\nFROM sessions s\nWHERE s.utm_campaign_name = \'sdk_validation\';', 0, '2025-01-29 14:05:04'),
(23, 'did I get any conversions yesterday', 'SELECT * FROM conversions \nWHERE timestamp >= CURRENT_DATE - INTERVAL \'1 day\' \nAND timestamp < CURRENT_DATE;', 0, '2025-01-29 14:06:42'),
(24, 'did I get any conversions yesterday', 'SELECT * FROM conversions \nWHERE timestamp >= CURDATE() - INTERVAL 1 DAY \nAND timestamp < CURDATE();', 0, '2025-01-29 14:06:48'),
(25, 'whats the average order value', 'SELECT AVG(cartValue) AS average_order_value\nFROM proceed_to_payment;', 1, '2025-01-29 14:08:10'),
(26, 'who brought the most products from the website', 'SELECT userId, COUNT(*) AS product_count\nFROM proceed_to_payment\nGROUP BY userId\nORDER BY product_count DESC\nLIMIT 1;', 1, '2025-01-29 14:08:53'),
(27, 'give me asummary of all my ad campaigns', 'SELECT \n    utm_campaign_name, \n    COUNT(*) AS total_sessions, \n    SUM(timeSpent) AS total_time_spent, \n    COUNT(DISTINCT userId) AS unique_users \nFROM \n    sessions \nWHERE \n    utm_campaign_name IS NOT NULL \nGROUP BY \n    utm_campaign_name \nORDER BY \n    total_sessions DESC;', 0, '2025-01-29 14:09:56'),
(28, 'What is the worst performing product in terms of revenue', 'SELECT productIds, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productIds\nORDER BY totalRevenue ASC\nLIMIT 1;', 0, '2025-02-01 08:49:18'),
(29, 'What is the worst performing product in terms of revenue', 'SELECT productName, SUM(cartValue) AS totalRevenue\nFROM proceed_to_payment\nGROUP BY productName\nORDER BY totalRevenue ASC\nLIMIT 1;', 1, '2025-02-01 08:50:15'),
(30, 'give me asummary of all my ad campaigns', 'SELECT utm_campaign_name, COUNT(*) AS session_count, SUM(timeSpent) AS total_time_spent\nFROM sessions\nGROUP BY utm_campaign_name;', 1, '2025-02-01 09:09:35'),
(31, 'give me asummary of all my ad campaigns', 'SELECT DISTINCT utm_campaign_name, utm_source, utm_medium\nFROM sessions\nWHERE utm_campaign_name IS NOT NULL\nAND utm_source IS NOT NULL\nAND utm_medium IS NOT NULL;', 0, '2025-02-01 09:12:30'),
(32, 'give me asummary of all my ad campaigns', 'SELECT \n    utm_campaign_name, \n    utm_campaign_id, \n    COUNT(DISTINCT trackingId) AS unique_users, \n    COUNT(id) AS total_sessions, \n    SUM(timeSpent) AS total_time_spent, \n    COUNT(DISTINCT CASE WHEN signup.id IS NOT NULL THEN signup.userId END) AS signups, \n    COUNT(DISTINCT CASE WHEN conversions.id IS NOT NULL THEN conversions.id END) AS conversions, \n    SUM(conversions.conversionValue) AS total_conversion_value \nFROM \n    sessions \nLEFT JOIN \n    signup ON sessions.id = signup.sessionId \nLEFT JOIN \n    conversions ON sessions.id = conversions.sessionId \nGROUP BY \n    utm_campaign_name, \n    utm_campaign_id;', 0, '2025-02-01 09:17:18'),
(33, 'give me asummary of all my ad campaigns', 'SELECT \n    utm_campaign_name, \n    COUNT(DISTINCT trackingId) AS total_users, \n    COUNT(DISTINCT sessionId) AS total_sessions, \n    SUM(timeSpent) AS total_time_spent, \n    COUNT(DISTINCT userId) AS total_signups\nFROM \n    sessions\nLEFT JOIN \n    signup ON sessions.id = signup.sessionId\nGROUP BY \n    utm_campaign_name;', 1, '2025-02-01 09:22:32'),
(34, 'what is my best performing campaign', 'SELECT utm_campaign_name, COUNT(*) AS total_sessions\nFROM sessions\nGROUP BY utm_campaign_name\nORDER BY total_sessions DESC\nLIMIT 1;', 1, '2025-02-01 10:08:13'),
(35, 'how many products are sold last month', 'SELECT COUNT(*) AS total_products_sold\nFROM proceed_to_payment\nWHERE timestamp >= DATE_TRUNC(\'month\', CURRENT_DATE - INTERVAL \'1 month\') \nAND timestamp < DATE_TRUNC(\'month\', CURRENT_DATE);', 0, '2025-02-04 02:49:55'),
(36, 'how many products were added to cart ysterday?', 'SELECT COUNT(*) AS products_added_to_cart\nFROM add_to_cart\nWHERE DATE(timestamp) = CURDATE() - INTERVAL 1 DAY;', 1, '2025-02-04 02:50:57'),
(37, 'how many products were added to cart last week', 'SELECT COUNT(*) AS products_added_to_cart\nFROM add_to_cart\nWHERE timestamp >= NOW() - INTERVAL 7 DAY;', 1, '2025-02-04 02:51:30'),
(38, 'how many people added products to cart last month', 'SELECT COUNT(DISTINCT userId) AS total_users_added_to_cart\nFROM add_to_cart\nWHERE timestamp >= DATE_TRUNC(\'month\', CURRENT_DATE - INTERVAL \'1 month\') \n  AND timestamp < DATE_TRUNC(\'month\', CURRENT_DATE);', 0, '2025-02-04 02:53:06'),
(39, 'which is the most popular product on our site', 'SELECT productName, COUNT(*) AS popularity\nFROM add_to_cart\nGROUP BY productName\nORDER BY popularity DESC\nLIMIT 1;', 1, '2025-02-04 02:54:38'),
(40, 'how many smartphones have we sold till date', 'SELECT COUNT(*) AS total_smartphones_sold\nFROM proceed_to_payment\nWHERE productName LIKE \'%smartphone%\';', 1, '2025-02-04 02:55:18'),
(41, 'what are people searching for on the website', 'SELECT searchTerm, COUNT(*) AS search_count\nFROM search_bar\nGROUP BY searchTerm\nORDER BY search_count DESC;', 1, '2025-02-04 02:56:26'),
(42, 'how many people visited the website till date', 'SELECT COUNT(DISTINCT trackingId) AS total_visitors FROM sessions;', 1, '2025-02-04 02:57:19'),
(43, 'which campaign brought the most users to the website', 'SELECT utm_campaign_name, COUNT(DISTINCT userId) AS user_count\nFROM sessions\nGROUP BY utm_campaign_name\nORDER BY user_count DESC\nLIMIT 1;', 0, '2025-02-04 02:59:33');
